from collections import defaultdict

def rearrange_matrix_to_impress_chefina(matrix, n, m):
    element_count = defaultdict(int)
    for row in matrix:
        for element in row:
            element_count[element] += 1
    rearranged_matrix = [[0] * m for _ in range(n)]
    for i in range(n):
        for j in range(m // 2):
            found = False
            for element in element_count:
                if element_count[element] >= 2:
                    rearranged_matrix[i][j] = element
                    rearranged_matrix[i][m - 1 - j] = element
                    element_count[element] -= 2
                    found = True
                    break
            if not found:
                return -1
    if m % 2 != 1:
        for i in range(n):
            for element in element_count:
                if element_count[element] >= 1:
                    rearranged_matrix[i][m // 2] = element
                    element_count[element] -= 1
                    break
    return rearranged_matrix

